import React from 'react'
import Carousel from 'react-bootstrap/Carousel';
import {CarouselItem} from 'react-bootstrap';
import img1 from './pictures/img1.png';
import img2 from './pictures/img2.png';
import img3 from './pictures/img3.png';
import img4 from './pictures/img4.jpg';
import img5 from './pictures/img5.png';
import img6 from './pictures/img6.png';
import item1 from './pictures/item1.webp';



function Homepage() {
  return (<div className='first d-flex'>
<Carousel>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={img1}/>
      </CarouselItem>
      <CarouselItem>
      <img className="nature" alt="homeimages" src={img2}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={img3}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature"  alt="homeimages" src={img4}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages"  src={img5}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={img6}/>
      </CarouselItem>

    </Carousel>
      <img className='nature1' src={item1}/>
   </div>

  )}

   export default Homepage
